import React from "react";
import { render } from "react-dom";
import Timeline from "react-visjs-timeline";
import moment from "moment";
import "./styles.css";


const options = {

  width: "100%",
  height: "90vh",
  // showMajorLabels: true,
  // showCurrentTime: true,
  zoomMin: 1000000,
  type: "range",
  orientation: "top",
  stack: true,
  editable: true,
  start: new Date("April 01, 2022 04:00:00"),
        end: new Date("April 08, 2022 11:00:00"),



};

const groups = [


  {
    id: "1",
    content: "Sales"
  },
  {
    id: "2",
    content: "Campaigns",
    subgroupOrder: "sborder"
  }

  // {   
  //   id: 1,
  //   content: "AUDI",

  //   items: ["The Audi"],  


  // },

  // {
  //   id: 2,
  //   content: "BMW",
  //   items: ["Interviews"],
  // },

  // {
  //   id: 3,
  //   content: "APPLE",
  //   items: [" Roadmap"],
  // },
];

const items = [];
groups.forEach((group) => {
  group.items.forEach((item) => {
    items.push({
      id: items.length,
      start: moment().startOf("day").add(items.length, "days"),
      end: moment()
        .startOf("day")
        .add(items.length + 5, "days"), 
      content: item,
      group: group.id,
    });
  });
});

const App = () => (
  <div className="timeline">
    <Timeline options={options} items={items} groups={groups} />
  </div>
);

render(<App />, document.getElementById("root"));
